import "./LoginPage.css";
import usernameIcon from "./icons/username.png";
import passwordIcon from "./icons/password.png"

function LoginPage() {
  return (
    <div className="center">
      <h1>
        Welcome to
        <br />
        Erasmus App!
      </h1>
      <div>
        <img className="usernameIcon" src={usernameIcon} alt=""></img>
      <input type="text" />
      </div>
      <div>
      <img className="passwordIcon" src={passwordIcon} alt=""></img>
      <input type="password" />
      </div>
    </div>
  );
}

export default LoginPage;
